'Brainstorming'=>'Brainstorming',
'GetStartedBrainstorming'=>'Første trin er meget vigtigt - tænk over dit affiliate program.<br/>
Du skal have en plan over hvad du ønsker at opnå. Hvor store kommissioner har du råd til?<br/>
