'Review your settings'=>'Gennemse dine indstillinger',
'GetStartedSettings'=>'Post Affiliate Pro er lavet på en måde så det kan fungere med standard konfigurationen.<br/>Men du bør alligevel tjekke din konfiguration og tilpasse den til dine behov.<br/>Du kan finde konfiguration panelet under <strong>Konfigurer & Værktøjer -> Konfiguration</strong>.<br/><br/>En detaljeret beskrivelse af alle konfigurationsmuligheder kan findes i vidensbasen.',
'Define your commissions'=>'Definer dine kommissioner',
'GetStartedCommissions'=>'En standard kampagne er oprettet under installationen. Du kan ændre den, eller oprette dine egne kampagner.<br/><br/>
Kampagner bliver brugt til at gruppere produkter (eller kun et produkt) som har samme kommissionsindstillinger.<br/><br/>
F.eks. kan du have en kampagne for Produkt1, hvor du vil belønne dine affiliates pr klik, og en anden kampagne for Produkt2, hvor affiliates modtager kommissioner pr salg.<br/><br/>
Eller du kan have en kampagne kaldet lavprisprodukter, hvor du giver 40% i kommission pr salg, og en anden kampagne kaldet dyre/eksklusive produkter med 15% i kommision pr salg.',
'Add banners and other creatives'=>'Tilføj bannere og andre kreativer',
'GetStartedCreatives'=>'I <strong>Banner manager</strong> kan du lave forskellige kreativer som tekst links, standard billede bannerere og HTML bannere eller Flash bannere.<br/>
Et hvert banner skal have specificeret en destinations URL - dette er URLen hvor brugerne bliver viderstillet efter et klik.',
'Set up emails'=>'Indstil emails',
'GetStartedEmails'=>'Du skal indstille email funktionaliteten. Dette inkluderer: <ul><li><strong>mail konto</strong> - hvordan emails bliver sendt. Du kan vælge enten mail() funktionen eller SMTP server.</li><li><strong>email skabeloner</strong> – disse skabeloner bruges når systemet udsender automatiske emails, som f.eks. efter registrering eller ved salgsnotificeringer</li><li><strong>email notificeringer</strong> – Du kan konfigurere hvilke slags notificeringer som du ønsker at modtage som annoncør, og hvilke notificeringer der vil være mulige for affiliates.</li></ul>Sørg for at mail konto er indstillet korrekt – prøv at teste mailudsending. Hvis det ikke virker vil affiliates ikke modtage bekræftelsesmails efter registrering, osv.',
'Customize your affiliate signup form'=>'Tilpas din affiliate registreringsform',
'GetStartedSignupForm'=>'Tjek standard registreringsformen og tilpas den, hvis du ønsker det.<br/><br/>
Registreringsformen kommer med et informations mini-site som indeholder informationer om affiliate programmet osv.<br/>Du kan bruge mini-sitet, eller slette det og kun bruge registreringsformen.',
'Customize affiliate panel'=>'Tilpas affiliate panel',
'GetStartedAffPanel'=>'Affiliate panelet i Post Affiliate Pro er meget sleksibelt.<br/>Du kan konfigurere hvordan menuen vil se ud, hvilket indhold du vil have, samt skrive dit eget indhold eller linke til en anden side.',
'GetStartedIntegrate'=>'Integration er en måde til at sammenkoble affiliate systemet med dit nuværende website, shopping kurv eller betalingsgateway på en måde så affiliate systemet vil blive underrettet om referenter og køb.<br/>
Når underrettet så registrerer affiliate systemet salget, finder den refererende affiliate (hvis der er nogen) og opretter de tilhørende kommisioner til ham/hende.<br/><br/>
Integration betyder normalt at du skal indsætte nogle få linie kode på dine sider, og det er beskrevet trin-efter-trin i Integrationsguiden for alle de mest kendte webshopsystemer og betalingssystemer.',
'Test everything'=>'Test alt',
'GetStartedTest'=>'Når du har konfigureret dine kampagner, defineret korrekte kommisioner, og oprettet nogle bannere/links, så skal du teste systemet.<br/>
Det bedste er at simulere hele processen fra både din og affiliates synsvinkel:
<ol>
<li>Registrer dig som en test-affiliate – efter godkendelse skal du modtage en bekræftelsesmail med dit password, og det skal være muligt at logge ind i affiliate panelet</li>
<li>Log ind i affiliates panelet, hent koder for bannere/links og put dem på en testside</li> 
<li>Klik på banneret og tjek at kliket er registreret</li>
<li>Efter kliket, så prøv at lave et testsalg og tjek at den korrekte kommission bliver registreret i affiliate systemet (gælder kun for salgs og lead kommissioner)</li>
</ol>

Hvis du oplever problemer i nogle af disse trin, så slå <strong>Debug event logging</strong> til og kig på <strong>Fejlfinding</strong>',
'Promote your affiliate program'=>'Promover dit affiliateprogram',
'GetStartedPromote'=>'Når du har testet integrationen af affiliate systemet med dit website, aå vil alt være klart til at du kan starte med at promovere dit nye affiliate program så du kan tiltrække nye affiliates.<br/><br/>
Det er et must at indsætte et link til dit affiliate program fra dit eget website. Navngiv linket Affiliate program, Webmastere tjen penge, Affiliates eller lignende. Dette vil tiltrække bruger til dit site og kan konvertere dem til at blive affiliates for dig.<br/><br/>
For at opnå flere affiliates, kan du tilføje dit affiliate program til de forskellige affiliate toplister der findes på nettet.',
